    false,nt"url": null,nt"notes": "The Light Detection and Ranging (LiDAR)
    dataset is a survey of the Suwannee River G12PD00242 1.0 Meter LiDAR Survey area
    2 in north-central Florida and encompasses 145 square miles. The LiDAR point cloud
    was flown at a nominal post spacing of 1.0 meters for unobscured areas. The LiDAR
    data and derivative products produced are in compliance with the U.S. Geological
    Survey National Geospatial Program Guidelines and Base Specifications, Version 1.
    The flight lines were acquired by Digital Aerial Solutions, LLC. between Jan 18,
    2013 and Jan 19, 2013. Derivative products from the aerial acquisition include:
    Raw point cloud data in LAS v1.2, classified point cloud data in LAS v1.2, bare
    earth surface tiles (raster DEM ESRI float GRID format), bare earth surface DEMs
    mosaic (raster DEM MrSID format), control points, project report, and FGDC compliant
    XML metadata.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
